// src/routes/Routes.js

import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import DataUpload from '../components/DataUpload';
import DataVisualization from '../components/DataVisualization';
import GPT3Insights from '../components/GPT3Insights';
import Preprocessing from '../components/Preprocessing';
import App from '../components/App';

const Routes = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={App} />
        <Route path="/upload" component={DataUpload} />
        <Route path="/visualize" component={DataVisualization} />
        <Route path="/insights" component={GPT3Insights} />
        <Route path="/preprocess" component={Preprocessing} />
      </Switch>
    </Router>
  );
};

export default Routes;
